  \"2016-07-27T22:52:26.359927\",\n\t\"name\": \"series-of-aerial-images-over-flint-hills-national-wildlife-refuge-acquired-on-november-20-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This data set includes 19 Georeferenced
  images, acquired on November 20, 1969, over Flint Hills National Wildlife Refuge.
  The frames were downloaded from Earth Explorer (USGS) and georeferenced within ArcGIS.
  The image files are named by frame number and can be referenced in the attached
  map. These images are Geo-referenced versions of original black and white aerial
  photographs downloaded from Earth Explorer (USGS). The original photo was georeferenced
  against the Coffey and/or Lyon County 2012 NAIP images depending on where the image
  was located. There are 19 total frames in this collection. The reference map can
  be used to identify locations of the images in relation to the refuge boundary.
  These images provide a valuable look back soon after refuge establishment (which
  was in 1966), and after closure of the John Redmond Dam and creation of the Reservoir
  on the Neosho River. These images (given their high resolution; scale 1:20:000)
  allow delineation of landscape features and habitats including which areas were
  farmed, native prairie, and woodlands at that time. Change over time estimates can
  be made from these images using current imagery for comparison. These images, and
  others from 1948 and 1950, are being used by refuge staff to assist in understanding
  and visualizing the historical content of the lands within the refuge and how they
  have changed over the last 50 years. Pixel resolution of this image is 0.5 meters.
  This image should be used for resource-level interpretation only.\",\n\t\"license_title\":
